        image: compass,
        text: 'Severs'
    },
    {
        image: eye,
        text: 'Shaders'
    },
    {
        image: dust,
        text: 'Mods'
    },
    {
        image: map,
        text: 'Maps'
    },
    {
        image: skins,
        text: 'skins'
    },
    {
        image: star,
        text: 'Textures'
    }

]


const Navbar = () =>{

return(

<navbar >
